  [],\n\t\"revision_timestamp\": \"2016-05-31T01:07:14.474331\",\n\t\"name\": \"alaska-phocid-morphometrics\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Polar Ecosystems Program research projects
  focus primarily on abundance, trends, distribution, health and condition, and foraging
  behavior of phocids (harbor, bearded, ringed, spotted, and ribbon seals) in Alaska.
  This database represents a collection of morphometrics obtained from all of these
  species across a variety of research projects. Morphometric data were collected
  from seals that were captured and sampled in the north Pacific, Bering and Chukchi
  Seas, in 2004-2012, 2014, 2015. There are also morphometric data from ribbon, spotted,
  and bearded seals that were collected during a research cruise in 1991. Data collected
  include lengths, girths, mass, and blubber thickness. \",\n\t\"license_title\":
